📍Fini Pizza, Williamsburg
⭐️9.3/10
@stoolpresidente gave it a 7.9 but it’s a 9.3 in my heart. Absolutely loved @finipizza ‘s white slice with lemon- one of my favorite new slices. Also had the tomato pizza with no cheese and garlic crumbs- the sauce itself was really good 🍕

📍Paulie Gees Slice Shop, Green Point
⭐️9.2/10
@pauliegees_sliceshop is an awesome slice. I like the square with pepperoni and hot honey, and I don’t typically like pepperoni, and their white slice a lot. One of the best white slices I’ve ever had. This is just a classic pie 🍕

📍Mareluna, Soho
⭐️6.5/10
@marelunanyc was a big let down. The pappardelle had a lot going on but somehow not a lot of flavor. The pasta was also extremely undercooked. Then, the cacio e pepe had so much pepper it wasn’t enjoyable to eat. Lastly, the tiramisu had so much coffee powder we were literally choking in the restaurant trying to eat it. I think this place has potential but I’m not going back anytime soon.

📍Hancock St, West Village 
⭐️9.3/10
@hancockstreet is such a refreshing restaurant for actually living up to the hype! The food was elevated classics, and their restaurants was beautiful inside.😍 This adult kids pasta is the epitome of what I think my at home pasta tastes like, not what it is. 🍝The biscuits were DELICIOUS with the onion too 🧅 Highly recommend checking out this spot, and if you make a rez in advance it’s w actually easy to get into! (Finally a place you like you can go)

📍Erewhon, Santa Monica
⭐️9.9/10
@erewhonmarket continues to blow me away with each new dish I try, this time the spicy salmon 🍣 on crispy rice took the crown 👑 I’m unsure how they managed to get, and keep, the rice so crispy… but they did! the fish is also very fresh. Also had a peanut butter blast smoothie and raw vegan cinnamon roll! 🥜

📍Little Door, LA
⭐️9.6/10
 @thelittledoorla was a delicious meal in the most beautiful setting. The restaurant is a garden with trees and plants everywhere and cute decor. 🌳 On top of the stunning ambiance, the food was delicious. The risotto (very heavy so be warned) was super flavorful with a heavy dousing of truffle, the mussels were a hit- the sauce was beyond yummy, the sea bass was unique and cooked to perfection, and the crème brûlée was excellent.🤌🏼 highly recommend this spot for an LA visit!

📍Almresi, Aspen
⭐️8.6/10
@almresi_aspen pleasantly surprised me! the Swiss spot was fully decked out in alps decor, and a menu to match.🏔️ We had a Bavarian pretzel with cheese dip, schnitzel, apple strudel, and (my favorite) an AMAZING potato pancake dish with crème fresh and delicious nova. 🤌🏼This spot is easy to get into, and more affordable for aspen! so glad I tried.☺️

📍Hickory House, Aspen
⭐️9.6/10
@hickoryhouseaspen is an amazing bbq spot I’ve been to a trillion times that was recently featured on Diners, Drive-ins, and Dives! 🚘 These baby back ribs are some of my favorites, and the Mac and cheese is out of this world. 🌎

📍Carbone, Greenwich Village
⭐️10/10
@carbonefinefood got a 10/10 on @beli_eats and became 4th on my list. It 100% lives up to the hype.😍 the spicy rigatoni is cooked to perfection and the perfect level of hot. The mozzarella is phenomenal. The prosciutto was the highest quality. The meatball was great. The SQUASH was the most surprising thing that blew me away- it was cooked to perfection and so soft that it kind of melted in your mouth, all in a delicious agrodolce sauce. Topped with marscapone and seeds in a delicious sauce. An amazing lemon cheesecake that was so beyond soft and creamy🍋, and some of the best rainbow cookies I’ve had in a looooong time. 🌈 carbone was amazing and everything was phenomenal. This meal blew me away. I’m so happy I finally got to go.

📍Little Rubys Cafe, Murray Hill
⭐️9.4/10
@rubyscafe is one of my favorite brunch spots, understand, but the Murrayhill location is my least favorite. It was nice, but we could just walk in, but it lacks the same ambience excitement that the others.🪩✨ Additionally, not getting the french fries really detracts from the overall food experience. The crispy rice bowl is still my favorite thing on the menu.❤️

📍Five Leaves, Greenpoint
⭐️7/10
@fiveleavesny is a solid lunch spot by mccaren park! The fries were great and crispy. It had very cozy fall vibes but a strange indoor layout with non ideal tables. 🥗

📍Swan, Miami
⭐️7.2/10 
@swanmiami is for the scene and the cocktails, but not as much the food.🍸The profiteroles, burger, octopus, and artichokes were good- not great. The steak was actually bad, 🥩 cooked well but no flavor. The inside garden is beautiful, and everyone’s having fun. Definitely a miami scene and fun to check out a Dave grutman restaurant! 🎬

📍Joe’s Stone Crab, South Beach 
⭐️ 9.9/10
@joesstonecrab is one of my favorite miami restaurants, and very iconic. My favorite dish will always be the key lime pie- aka a miami classic. I also highly recommend their fried chicken and lobster Mac if you’re not getting stone crabs! 🦀 you have to stop by joes on your next miami trip! 🏝️

📍Mandolin Aegean Bistro, Miami
⭐️10/10
@mandolinrestaurants is perfection. With a beautiful outdoor patio, and delicious menu, what more could you want? They do simple dishes like prawns so well, as well as the more unique manti dumplings featured first! My favorite dish was actually the mussels - because the herb sauce was phenomenal 😍 can’t recommend mandolin enough next time you’re in Miami❤️

📍Lemongrass Asian Bistro, Boynton Beach 
⭐️7.3/10
@lemongrassasianbistro was a super solid Asian fusion spot in Boynton Beach, Delray, and Boca! We got sushi, pad Thai, bao, and spring rolls. The sushi was a little bland - but the spring rolls, bao, and pad Thai were good! also, really affordable. really recommend if you’re in the area! 🍱

📍Al Fresco, Palm Beach 
⭐️9/10
@alfrescopb is an Italian spot right on a golf course by the water. 🌊 had the spicy rig this time and it made me like the restaurant’s food better! rig was really good, meatballs were delicious, and carpaccio was excellent. prices were very fair too! def worth a visit in PB🌴

📍Arthur and Sons, West Village
⭐️9.3/10
@arthurandsons is 🔥classic menu, delicious dishes, and well priced. the rigatoni was my favorite dish- very soft and cheesy 🧀 And the Spumoni to end was amazing and it looks like a cute little bear! 🐻

📍Spes Natural Wine, East Village 
⭐️8.7/10
@spes.naturalwine was a wonderful experience in the east village. The space inside is so intimate and romantic, would highly recommend for a date. You “spin a wheel” (or pick yourself) wine descriptors then they bring you some to try. Andy was awesome- we tried an array of wines to find one we liked. They had delicious bites, and a surprisingly good tiramisu. Highly recommend! 🍷

📍Gjelina, Venice
⭐️9.5/10
@gjelinarestaurant is a culinary experience where every dish is interesting, flavorful, and well thought out. the menu was big… but we got carrots from the veggie section, Moroccan eggs, kimchi eggs, and banana bread!🤰🏼 The banana bread had an orange marmalade on the side that made it >>> and the dill sauce on the Moroccan eggs just>> I was really disappointed with the host and thought the service left much to be desired, but food was Gjelina fully lived up to the hype🫶🏼

📍La Pecora Bianca, Soho
⭐️8.0/10
@lapecorabianca gave me a MUCH better brunch experience than dinner! These pancakes were actually insanely good, and I highly recommend.🥞 The soho location had a great inside/outside feel for a warm day, and a reservation for brunch is always a + in my column!🫶🏼

📍Buttermilks Kitchen, Atlanta
⭐️9.2/10
@buttermilkskitchen is a MUST HAVE for brunch when you’re visiting Atlanta. The fried chicken and the sausage and biscuits were to die for. The latte was the size of my head. No complaints this place is a hit! Try to get a reservation on @opentable if you can though bc it gets crowdddeddd🤠

📍Beetlecat, Atlanta
⭐️6.3/10
@beetlecatatl has wonderful seating and a menu that falls short of what it lists. I was underwhelmed by the food, and disappointed by the service. The donuts weren’t flavored to what they were listed, just the toppings. Then my yogurt bowl was just fine. It’s nice to go sit out, but head somewhere else for better food! 🍩

📍L’industrie, Williamsburg
⭐️9.2/10
@lindustriebk makes a great slice, but if you’re in the area, I think @finipizza is better. We waited in line, then once we ordered, it took 25 MINUTES to finally get our pizza. Honestly, it felt a little ridiculous. Then, the pizza itself was still really good, hence the 9.2, but I’ve had better in this competitive nyc pizza game🤷🏼‍♀️

📍Oceans, NY
⭐️8.1/10
@oceansnewyork got a @beli_eats rerank from this second trip and score 1.5 points higher! Truly, it all came down to a much better meal. The whole sashimied fish was spectacular in both freshness and quality. Additionally, I tried the seafood tower! Had lots of different things to try which was fun- the lobster being the best.

📍Morgensterns, LES
⭐️10/10
@morgensternsnyc ‘s new dairy free “Bananas” in the LES is SPECTACULAR. Rarely does anywhere get a 10/10 from me on @beli_eats , but they did easily. The soft serve was the perfect smooth and creamy, and the flavors were delicious. Vanilla banana was out of this world, and the rainbow krispies added a fun touch. HIGHLY recommend this spot. 🍌🍨

📍Osteria Morini, Soho
⭐️8.8/10
@osteriamorini does a $15 pasta Monday special where all their pastas are $15 (except the lobster one) and you shouldn’t miss it! Went for a Monday dinner and my pasta was delicious, didn’t reach the 9s for meg service and only a fine tiramisu. But overall, good spot that I recommend! 🍝

📍Peter Luger, Brooklyn
⭐️9.7/10
@peterlugersteakhouse deserves the hype. the steak was delicious and tender, the salad hit the spot, and the fudge sunday with their homemade whipped cream SLAPPED (sorry, I had to)… 🤷🏼‍♀️ highly recommend this is an institution, and the martini too >>> old school for a reason😎

📍Babbo Mio, Nice
⭐️8/10
@babbomio_nice had a large outdoor patio, diverse menu, and delicious drinks. The pasta I thought was only fine, but I was in AWE of how large the bowl was?! Poor servers having to carry multiple of those around🥲Def a solid spot to checkout if you’re visiting nice!

📍Nowon, East Village
⭐️9.7/10
@nowon.usa ‘s has earned the right to call their burger legendary. this double decker burger is absolutely delicious, flavorful, and melts right in your mouth. they killed it and you have to check it out.

📍Sonny Boy, LES
⭐️7.7/10
@sonnyboy_nyc is a solid spot with easy reservations! finally tried their beloved fig toast, and it was good, but it’s a LOT of fig. also had the kale Caesar! the price of adding chicken wasn’t worth it. totally check it out if you’re in the area and want to try something new!

📍Two Hands, Nolita
⭐️6.2/10
@twohandsrestaurant was a disappointment. this beloved banana bread was dry, the only redeeming part was the top. also, the service was extremely subpar… big skip ‼️

📍Kyu, Noho
⭐️8.8/10
@kyunyc was absolutely delicious! the crispy rice, halibut, and s’mores dessert were my favorite, but everything was good. also, it was easy to get a reservation which I know personally I’m always looking for restaurants like that! worth checking out 🍣💕

📍L’Artusi, West Village 
⭐️9.8/10
@lartusi strikes again with the best cacio e pepe in nyc! on top of that, I was baffled by how good the steak was (sleeper dish) and so excited to see the sundae flavor was an Italian cookie?! always a hit, highly recommend lartusi if you can get a reservation!📖

📍Cache Cache, Aspen
⭐️9.8/10
 @cachecacheaspen never misses. spectacular constantly. Highly recommend on your next trip.

📍Forsynthia, LES
⭐️9.8/10
@forsythia_nyc had the best food, great vibes, and amazing service. short rib agnolotti (featured 1st) was my favorite. the noodles and meat just melted in my mouth. loved the crunch on the short rib meatball, the freshness of the carbonara, and the uniqueness of the tartar. HIGHLY HIGHLY HIGHLY recommend a visit💛

📍Oxomoco, Greenpoint
⭐️9.5/10
@_oxomoco_ has one Michelin star, and was delicious. tuna tostada is a must have, vibes are good, and the drinks are delicious. lives up to the hype. the pork chop was a great deal, but swordfish tacos we felt were a bit of a rip off. overall, delicious though ✨

📍Cosme, NYC
⭐️9.4/10
@cosmenyc was great! one of those places where what they have the hype over truly is the best thing- duck carnitas (photo 1) and corn husk meringue (5) were my favorites, but everything else was good too. highly recommend a visit!

📍Rezdora, Flat Iron
⭐️9.2/10
@rezdoranyc flat iron was a great experience and delicious meal! while idk if it was Michelin star worthy, I highly recommend for some good Italian. grandma walking through the forest and dessert are must haves

📍Bananas, LES
I can’t stop going BANANAS over 
@morgensternsnyc 🍌 this spot is so good- I like the vanilla banana the best. sneaking in all the cold treats I can during this nyc weather uptick 🥰

📍I Sodi, West Village 
⭐️10/10
@ritasodi … no notes. the lasagna is one of my top 3 pasta dishes in nyc, and I have no notes. this dish makes lasagna sexy, delicious, and a relevant dish. on top of it all, the chocolate tort was rich and good (super well priced too), and the onion pasta pleasantly surprised me too! def a dish worth getting. if you can get in to i sodi, you have to go 🍝

📍Rule of Thirds, Greenpoint 
⭐️8.3/10
@thirdsbk is an extremely solid spot in Greenpoint. It has a beautiful, ambience inside, really interesting drinks, and a delicious menu.🧚🏼‍♀️ I basically tried the entire thing, and I highly recommend the sashimi, brussel sprouts, karaage , and the rice ball skewer. Great spot for groups as well‼️

📍Laurel Hardware, WeHo
⭐️9.2/10
@laurelhardware doesn’t disappoint! the best dishes are by far the branzino and the ribs, but the steak was a surprising favorite this trip. the vibes are good, the drinks are yummy, and the patio is so nice with all these lights. unfortunately, we didn’t sit in it though. recommend for your next LA trip! 🌴

📍Polo Bar, Midtown
⭐️9.4/10
@thepolobar has the most elite vibes of any restaurant in nyc. while the food is not legendary, it’s super good and the vibes are. cocktails are amazing, decor is awesome, and staff is super nice. highly, highly, HIGHLY recommend. 🍸
